'use strict';
let GetSsoTokenMessage = require('./GetSsoTokenMessage.js');
let StringUtil = require('./StringUtil.js');
//@@DocBrief("The builder of the GetSsoTokenMessage class")
class GetSsoTokenMessageBuilder extends GetSsoTokenMessage {
    constructor() {
        super();
        this.error = null;
    }
    setError(error) {
        this.error = error;
    }
    setToken(token) {
        this.token = token;
    }
    setRequestNumberByRequestId(requestId) {
        this.requestNumber = StringUtil.getRequestNumber(requestId);
    }
    build() {
        return this;
    }
}
module.exports = GetSsoTokenMessageBuilder
